import React, { useState } from "react";
import Modal from "react-modal";
import Register from "../../pages/register";
import Login from "../../pages/login";
import { Link } from "react-router-dom";

import { Nav, NavLink, NavMenu, NavBtn, NavBtnLink } from "./NavbarElement";

Modal.setAppElement("#root");

const Navbar = () => {
  const [isModalOpen, setModalOpen] = useState(false);

  const handleModalOpen = () => {
    setModalOpen(true);
  };

  const handleModalClose = () => {
    setModalOpen(false);
  };

  return (
    <div className="Index">
      <Nav>
        <Link to="/home">
          <img
            src="./images/sonnenspiele-logo.webp"
            alt="Logo"
            style={{ width: "auto", height: "50px", margin: "10px" }}
          />
        </Link>
        <NavMenu>
          <NavLink to="/products" activeStyle>
            Alle virtuelle Automatenspele!
          </NavLink>
          <NavLink onClick={handleModalOpen} activeStyle>
            Anmelden
          </NavLink>
          <NavBtn>
            <NavBtnLink onClick={handleModalOpen}>Registrieren</NavBtnLink>
          </NavBtn>
        </NavMenu>
      </Nav>
      <Modal
        isOpen={isModalOpen}
        onRequestClose={handleModalClose}
        style={{
          content: {
            width: "40%",
            height: "90%",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
            borderRadius: "8px",
          },
        }}
      >
        {isModalOpen ? <Register /> : <Login />}
      </Modal>
    </div>
  );
};

export default Navbar;
